Desc:
Having barely survived a robbery gone wrong that leaves his fiancee dead, Tommy miraculously discovers that he has acquired the powers of an eagle. With his extraordinary new faculties of sight and flight, Tommy vows to clean up the crime-ridden city that took his love, first targeting Big Lee, the gangster who holds the city under his crooked thumb. Upon discovering a young girl whose sister has been forced into prostitution by Lee and his thugs, Tommy sets out to set things right, both for the poor girl`s family, and for the love he was deprived of.
